$('.sidenav li').click(function ()
{
    if ($(this).hasClass('active'))
    {
        var action = 'close';
    } else
    {
        action = 'open';
    }
    $('.sidenav li').each(function ()
    {
        $(this).removeClass('active');
    });
    if (action == 'open')
    {
        $(this).addClass('active');
    }


});

